"use strict";(globalThis.webpackChunkink_nest=globalThis.webpackChunkink_nest||[]).push([[301],{6376:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"release-v1.4.2","metadata":{"permalink":"/InkNest/blog/release-v1.4.2","source":"@site/blog/2025-12-02-release-v1.4.2.md","title":"InkNest v1.4.2 Release","description":"Hey everyone! \ud83c\udf89 We\'re excited to announce InkNest v1.4.2 is now available!","date":"2025-12-02T00:00:00.000Z","tags":[{"inline":false,"label":"Release","permalink":"/InkNest/blog/tags/release","description":"Release announcements and updates"}],"readingTime":1.28,"hasTruncateMarker":true,"authors":[{"name":"P2Devs","title":"InkNest Team","url":"https://github.com/p2devs","imageURL":"https://github.com/p2devs.png","key":"p2devs"}],"frontMatter":{"slug":"release-v1.4.2","title":"InkNest v1.4.2 Release","authors":["p2devs"],"tags":["release"]},"unlisted":false,"nextItem":{"title":"InkNest v1.4.1 Release","permalink":"/InkNest/blog/release-v1.4.1"}},"content":"Hey everyone! \ud83c\udf89 We\'re excited to announce **InkNest v1.4.2** is now available!\\n\\n\x3c!-- truncate --\x3e\\n\\n## \u2728 What\'s New\\n\\n### \ud83d\udd0d Chapter Search & Navigation\\n- **Searchable Chapter List** - Quickly find specific chapters with the new search functionality\\n- **Sort Toggle** - Switch between ascending/descending order for easier navigation\\n- **Smart Search Display** - Search bar only appears for comics with longer chapter lists\\n\\n### \ud83d\udcd6 Recent Reading History\\n- **New \\"Recent\\" Tab** - Access your recently read chapters sorted by when you last read them\\n- **Per-Chapter Timestamps** - Each chapter now tracks when you last read it (`readAt`)\\n- **Seamless History Tracking** - Reading progress is automatically saved with timestamps\\n\\n### \u26a1 Performance & Stability\\n- **Improved Error Handling** - Better handling around rewarded ads and detail fetching with Crashlytics integration\\n- **Stable Key Generation** - More reliable list rendering with stable keyExtractor\\n- **Conditional Pagination** - Smarter pagination and footer handling in chapter lists\\n- **Dependency Updates** - Updated core packages for better stability\\n\\n### \ud83d\udc1b Bug Fixes\\n- Fixed duplicate keys by normalizing detail/chapter links\\n- Preserved existing `readAt` timestamps when updating progress\\n- Improved error handling for edge cases\\n- Removed unused imports and props for cleaner code\\n\\n### \ud83e\uddf9 Code Quality\\n- Simplified useEffect dependencies throughout the codebase\\n- Refactored reducer logic for better progress tracking\\n- iOS feature-flag override improvements\\n\\n---\\n\\n**Update now** to enjoy a smoother chapter navigation experience! \ud83d\udcda\\n\\nAs always, if you encounter any issues, please report them in our issues channel. Happy reading! \ud83e\udd8b"},{"id":"release-v1.4.1","metadata":{"permalink":"/InkNest/blog/release-v1.4.1","source":"@site/blog/2025-11-27-release-v1.4.1.md","title":"InkNest v1.4.1 Release","description":"Hey everyone! \ud83c\udf89 We\'re excited to announce InkNest v1.4.1 is now available!","date":"2025-11-27T00:00:00.000Z","tags":[{"inline":false,"label":"Release","permalink":"/InkNest/blog/tags/release","description":"Release announcements and updates"}],"readingTime":1.635,"hasTruncateMarker":true,"authors":[{"name":"P2Devs","title":"InkNest Team","url":"https://github.com/p2devs","imageURL":"https://github.com/p2devs.png","key":"p2devs"}],"frontMatter":{"slug":"release-v1.4.1","title":"InkNest v1.4.1 Release","authors":["p2devs"],"tags":["release"]},"unlisted":false,"prevItem":{"title":"InkNest v1.4.2 Release","permalink":"/InkNest/blog/release-v1.4.2"},"nextItem":{"title":"InkNest v1.4.0 Release","permalink":"/InkNest/blog/release-v1.4.0"}},"content":"Hey everyone! \ud83c\udf89 We\'re excited to announce **InkNest v1.4.1** is now available!\\n\\n\x3c!-- truncate --\x3e\\n\\n## \u2728 What\'s New\\n\\n### \ud83d\udcd6 Enhanced Offline Reading Experience\\n- **Progress Tracking for Local Comics** - Your reading progress is now saved for downloaded comics, so you can pick up right where you left off!\\n- **Header Visibility Controls** - Improved UI controls while reading\\n\\n### \ud83d\udd04 Sync Downloads Feature\\n- **Sync Downloads UI** - Detects missing local files and provides a convenient \\"Sync Downloads\\" option to restore your offline comics\\n- **Sync Progress Display** - See real-time progress when re-syncing your downloads\\n\\n### \u26a1 Performance Improvements\\n- **Optimized History View** - Progress calculations now use `useMemo` for better performance\\n- **Smoother Vertical Reading** - Unified scroll handling for vertical view with stable initial scroll positioning\\n- **Reduced Re-renders** - Better use of `useCallback`/`useMemo` throughout the reader\\n\\n### \ud83d\udc1b Bug Fixes\\n- Fixed scroll jitter in vertical reader mode\\n- Better handling of empty data and edge cases\\n- Safer index handling to prevent out-of-range errors\\n- Improved path normalization for downloads\\n\\n### \ud83d\udee0\ufe0f Developer Experience\\n- Added setup script for easier project initialization\\n\\n### \ud83c\udf10 Documentation Website Refresh\\nWe\'ve given our documentation website a complete makeover! Here\'s what\'s new:\\n\\n- **Modern Homepage Design** - Fresh hero section with gradient effects, animated feature cards, and a sleek tech stack showcase\\n- **Redesigned Blog Section** - Beautiful card-based layout with hover animations for release notes and updates\\n- **New FAQ Page** - Interactive accordion-style FAQ with categorized questions covering app features, troubleshooting, and more\\n- **Improved Dark Mode** - Enhanced dark theme support across all pages for comfortable reading\\n- **Better Visual Hierarchy** - Glassmorphism effects, smooth transitions, and modern typography throughout\\n\\nVisit our [documentation site](https://p2devs.github.io/InkNest/) to check out the new look! \ud83c\udfa8\\n\\n---\\n\\n**Update now** to enjoy a smoother, more reliable reading experience! \ud83d\udcda\\n\\nAs always, if you encounter any issues, please report them in our issues channel. Happy reading! \ud83e\udd8b"},{"id":"release-v1.4.0","metadata":{"permalink":"/InkNest/blog/release-v1.4.0","source":"@site/blog/2025-10-10-release-v1.4.0.md","title":"InkNest v1.4.0 Release","description":"Hey everyone! \ud83c\udf89 We\'re thrilled to announce InkNest v1.4.0 - a major update packed with exciting new features!","date":"2025-10-10T00:00:00.000Z","tags":[{"inline":false,"label":"Release","permalink":"/InkNest/blog/tags/release","description":"Release announcements and updates"}],"readingTime":1.135,"hasTruncateMarker":true,"authors":[{"name":"P2Devs","title":"InkNest Team","url":"https://github.com/p2devs","imageURL":"https://github.com/p2devs.png","key":"p2devs"}],"frontMatter":{"slug":"release-v1.4.0","title":"InkNest v1.4.0 Release","authors":["p2devs"],"tags":["release"]},"unlisted":false,"prevItem":{"title":"InkNest v1.4.1 Release","permalink":"/InkNest/blog/release-v1.4.1"},"nextItem":{"title":"InkNest v1.3.9 Release","permalink":"/InkNest/blog/release-v1.3.9"}},"content":"Hey everyone! \ud83c\udf89 We\'re thrilled to announce **InkNest v1.4.0** - a major update packed with exciting new features!\\n\\n\x3c!-- truncate --\x3e\\n\\n## \u2728 What\'s New\\n\\n### \ud83d\udcda Local Comic Reading Support\\nThis is a huge update! You can now **read your own comic files** directly in InkNest:\\n- **CBZ, CBR, ZIP, and RAR Support** - Import and read comic archives from your device\\n- **Open Documents in Place** - Seamlessly open comic files from your file manager\\n- **iOS External File Handling** - Full support for opening CBR/CBZ files on iOS\\n\\n### \ud83d\udcd6 Enhanced Library Features\\n- **New Library Screen** - Manage your imported comics with ease\\n- **Continue Reading Section** - Pick up where you left off with your local comics\\n- **Reading History with Progress Tracking** - See your reading progress at a glance\\n- **Comic Bookmarks Screen** - Save and organize your favorite pages\\n\\n### \ud83d\udd04 ComicHubFree Integration Restored\\n- Restored ComicHubFree API integration\\n- Updated search functionality for better results\\n\\n### \ud83d\udce5 Download Improvements\\n- Enhanced comic download functionality\\n- Set initial image index for better experience\\n\\n### \ud83d\udee0\ufe0f Under the Hood\\n- Added InkNest-Externals submodule for external dependencies\\n- Added scripts for managing git submodules\\n- Improved BottomNavigation component structure\\n- Simplified Settings component\\n- Renamed \'Offline\' to \'Downloaded\' for clarity\\n\\n---\\n\\n**Update now** and start reading your own comic collection! \ud83d\udcda\ud83e\udd8b"},{"id":"release-v1.3.9","metadata":{"permalink":"/InkNest/blog/release-v1.3.9","source":"@site/blog/2025-08-05-release-v1.3.9.md","title":"InkNest v1.3.9 Release","description":"Hey everyone! \ud83d\udc4b InkNest v1.3.9 is now available with a quick maintenance update.","date":"2025-08-05T00:00:00.000Z","tags":[{"inline":false,"label":"Release","permalink":"/InkNest/blog/tags/release","description":"Release announcements and updates"}],"readingTime":0.38,"hasTruncateMarker":true,"authors":[{"name":"P2Devs","title":"InkNest Team","url":"https://github.com/p2devs","imageURL":"https://github.com/p2devs.png","key":"p2devs"}],"frontMatter":{"slug":"release-v1.3.9","title":"InkNest v1.3.9 Release","authors":["p2devs"],"tags":["release"]},"unlisted":false,"prevItem":{"title":"InkNest v1.4.0 Release","permalink":"/InkNest/blog/release-v1.4.0"}},"content":"Hey everyone! \ud83d\udc4b **InkNest v1.3.9** is now available with a quick maintenance update.\\n\\n\x3c!-- truncate --\x3e\\n\\n## \ud83d\udd27 Changes\\n\\n### \ud83d\udee0\ufe0f Maintenance Update\\n- **Temporarily disabled ComicHubFree integration** - We\'ve commented out the ComicHubFree integration while we work on improvements. This ensures a stable experience while we prepare enhanced functionality for an upcoming release.\\n\\n---\\n\\nThis is a minor maintenance release. Stay tuned for v1.4.0 which brings exciting new features including local comic reading support! \ud83d\udcda"}]}}')}}]);